import React from "react";

const FortuneTeller = ({ fortune, auraColor, generateFortune }) => {
  return (
    <div class="result">
      <h2>Your personalised Fortune</h2>
    {!fortune ? 
    <span> <p>Are you ready to meet your destiny?</p>
    <button onClick={generateFortune}>Fortune</button></span>
    :(<p>{fortune}</p>) }
    </div>
  );
};


export default FortuneTeller;
